import React from 'react';

const Body = () => {
    const style = {
        backgroundColor: "#f8f9fa",
    };
    return (
        <>
            <div className="row">
                <div className="col-md-8" style={style}></div>
                <div className="col-md-1"></div>
                <div className="col-md-3" style={style}></div>
            </div>

        </>
    );
};

export default Body;
